const initialState = [
    {
        id: 'JS',
        title: 'JavaScript',
        imgURL: 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/99/Unofficial_JavaScript_logo_2.svg/1200px-Unofficial_JavaScript_logo_2.svg.png',
        native: {
            id: 'JavaScript',
            imgURL: 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/99/Unofficial_JavaScript_logo_2.svg/1200px-Unofficial_JavaScript_logo_2.svg.png'
        },
        react: {
            id: 'react',
            imgURL: 'https://cdn.iconscout.com/icon/free/png-256/react-1-282599.png'
        },
        angular: {
            id: 'angular',
            imgURL: 'https://www.pngitem.com/pimgs/m/498-4986855_transparent-fashion-icon-png-angular-js-logo-png.png'
        },
        vue: {
            id: 'vue',
            imgURL: 'https://w0.pngwave.com/png/21/719/vue-js-javascript-angularjs-front-and-back-ends-typescript-github-png-clip-art.png'
        }

    },
    {
        id: 'CSS',
        title: 'CSS',
        imgURL: 'https://www.kindpng.com/picc/m/464-4640184_css3-png-download-css-icon-transparent-png.png'
    },
    {
        id: 'HTML',
        title: 'HTML',
        imgURL: 'https://icons.iconarchive.com/icons/cornmanthe3rd/plex/512/Other-html-5-icon.png'
    }
]

export const catalogReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state
    }
}
